import React, {useState} from 'react'
import {Container, Grid, Paper} from '@material-ui/core'
import Breadcrumbs from "@material-ui/core/Breadcrumbs";
import Link from "@material-ui/core/Link";

import Home from "./Components/Home";
import Skills from "./Components/Skills";
import Project from "./Components/Project";

import {makeStyles} from "@material-ui/core/styles";
import './App.css';

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
}));

export default function App() {
    const [currentComponent, setCurrentComponent] = useState(<Home/>);
    const styles = useStyles();

    return (
        <Container maxWidth={false}>
            <div className={styles.root}>
                <Grid container spacing={3}>
                    <Grid item xs={12}>
                        <Breadcrumbs aria-label={"breadcrumb"} className={styles.paper}>
                            {console.log(currentComponent !== <Home/>? 'initial':'inherit')}
                            <Link color={currentComponent !== <Home/>? 'initial':'inherit'} onClick={() => setCurrentComponent(<Home/>)}>
                                Home
                            </Link>
                            <Link color={'inherit'} onClick={() => setCurrentComponent(<Skills/>)}>
                                Skills
                            </Link>
                            <Link color={'inherit'} onClick={() => setCurrentComponent(<Project/>)}>
                                Project
                            </Link>
                        </Breadcrumbs>
                    </Grid>
                    <Grid item xs={12}>
                        {currentComponent}
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <Paper className={styles.paper}>xs=12 sm=6</Paper>
                    </Grid>
                    <Grid item xs={12} sm={6}>
                        <Paper className={styles.paper}>xs=12 sm=6</Paper>
                    </Grid>
                    <Grid item xs={6} sm={3}>
                        <Paper className={styles.paper}>xs=6 sm=3</Paper>
                    </Grid>
                    <Grid item xs={6} sm={3}>
                        <Paper className={styles.paper}>xs=6 sm=3</Paper>
                    </Grid>
                    <Grid item xs={6} sm={3}>
                        <Paper className={styles.paper}>xs=6 sm=3</Paper>
                    </Grid>
                    <Grid item xs={6} sm={3}>
                        <Paper className={styles.paper}>xs=6 sm=3</Paper>
                    </Grid>
                </Grid>
            </div>
        </Container>
    );
}
